export default (function(a,b,c,d,e,f){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},"3B1CfYDwQz":{data:{id:2421,attributes:{imdbId:"tt0098659",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjc0NGIyNTctOWFhOS00NGEzLWIzZDYtMzYzYTgyZjM0Y2Q0XkEyXkFqcGdeQXVyMTY5Nzc4MDY@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"11%"}],item_lang:{data:{id:3084,attributes:{title:"Winter People",plot:"A young widower moves with his daughter into a North Carolina mountain town in 1934. He quickly takes up with a young woman with an illegitimate baby. First he must prove himself to her father and her three brothers. He does so first by joining them on a bear hunt and then by designing a clock tower for the small community. Trouble comes when it is revealed that the baby's father is the demented son of a mean clan across the river and they mean to take the child back.",slug:"winter-people"}}},books:{data:[{id:11710,attributes:{title:"The Winter People",description:"Reissue of the classic novel The Winter People, scanned from the original 1981 First Edition.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=w2HRswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2017-10-15",publisher:"Press 53 Carolina Classics",subtitle:a}},{id:11711,attributes:{title:"Winter people",description:a,thumbnail:a,authors:[b],firstBook:d,published:"1989-01-01",publisher:a,subtitle:a}},{id:11712,attributes:{title:"Lion on the Hearth",description:"Lion on the Hearth is the story of the King family, successful merchants in Great Depression-era Asheville, North Carolina, where trading, competing, and risk taking are necessary for survival, and where greed and lust for love and power tests the limits of a strong, ambitious family. First published by Harper & Row in 1961, Lion on the Hearth is chronologically the sixth book in John Ehle's seven-book Appalachian series that includes The Land Breakers, The Journey of August King, Time of Drums, The Road, The Winter People, and Last One Home.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=IrAkjgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2015-09-01",publisher:a,subtitle:a}},{id:11713,attributes:{title:"Time of Drums",description:"John Ehle's classic civil war novel, Tome of Drums, returns to print as a Press 53 Classic. Book three in his seven-book Appalachian series. Borden Deal said: \"There have been many books about the Civil War; none of them, with the exception of The Red Badge of Courage, have comes close to the dusty, bloody, grinding truth that John Ehle writes about. Time of Drums is not only the story of men launched into a war with uncertain loyalties, but more important, it continues the Wright saga that John Ehle began with The Land Breakers and promises to expand into one of the great fictional sagas of American history.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=N37MoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2014-04-01",publisher:a,subtitle:a}},{id:11714,attributes:{title:"Move Over, Mountain",description:"When first published in 1957, \"Move Over, Mountain\" was considered to be the first book written by a white novelist that portrayed African-Americans without stereotype. It received positive reviews from several major publications, but was shunned by segregated bookstores and libraries. There was only one US printing of \"Move Over, Mountain.\" The following year it was published by Hodder and Stoughton of London, England. A story of personal and social struggle, the New York Times said of John Ehle in 1957, \"It is quite obvious that he writes from a deep knowledge of his subject, and an understanding of technique rare in a first novelist.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F3UVPQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2007-08-01",publisher:a,subtitle:"50th Anniversary Edition"}}]}}},meta:{}}},prerenderedAt:1681703473766}}("","John Ehle","movie",null,"series",1))